import React, { useEffect, useState } from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import { fetchFaq } from '../Api/Api';
import styles from "./Accordin.module.css";

const Accordin = () => {

  const [data,setData] = useState([]);

  const generateFaqData = async ()=>{
    const res = await fetchFaq();
    console.log(res.data)
    setData(res.data)
  }
  
useEffect(()=>{
  generateFaqData();
},[])
  

  return (
    <div>
       <Accordion className={styles.wrapper}>
             

             {data.map((elem)=>{
              return(
                <Accordion><AccordionSummary
                  aria-controls="panel1a-content"
                  id="panel1a-header"
                >
                  <Typography>{elem.question}</Typography>
                </AccordionSummary><AccordionDetails className={styles.wrapper}>
                    <Typography>
                     {elem.answer}
                    </Typography>
                  </AccordionDetails></Accordion>
              )
             })}
       
           

        
       
       
      </Accordion>
    </div>
  );
}

export default Accordin;
